fn quicksort(mut start: Vec<f64>, lo: usize, hi: usize) -> Vec<f64> {
    if lo >= hi {
        return start
    }
    let mut j = lo;
    for i in lo..hi {
        j+=1;
        if start[i] > start[j] {
            (start[i], start[j]) = (start[j], start[i]);
        }
    }
    if j != 0 {
        start = quicksort(start, lo, j-1);
    }
    start = quicksort(start, j+1, hi);
    return start
}
